getApi();

let page = 1;


$(".np").on("click", function(){
    page++;
    $(".card").remove();
    getApi(page);
    $(".cur-page").text(page)
})

$(".pp").on("click", function(){
    if(page != 1)
    {
        page--;
        $(".card").remove();
        getApi(page);
        $(".cur-page").text(page)
    }
})

function createDisplay(data)
{
    data.forEach(elem => {
        const name = `<h2> ${elem.name} </h2>`;
        const title = elem.title;
        let poster
        if(elem.backdrop_path != null){
            poster = `<img src="https://image.tmdb.org/t/p/w500/${elem.backdrop_path}" alt="backdrop">`
        }
        else{
            poster = "<img src='images/missing.png' alt='MISSING PICTURE'>"
        }
        const popul = `<p>Popularity: ${elem.popularity}</p>`
        const overview = `<p class="overview">${elem.overview} </p>`
        const medType = `<span>${elem.media_type}</span>`
        const release = `<time>Release date: ${elem.release_date}</time>`
        const firstAir = `<time>First aired: ${elem.first_air_date}</time>`
        if(title == null)
        {
            const card = `<div class="card">${poster} ${name} <hr> ${overview} <div class="info"> ${medType} ${firstAir} ${popul} </div></div>`
            $(".holder").append(card)
        }
        else{
            const card = `<div class="card">${poster} <h2>${title}</h2> <hr> ${overview} <div class="info"> ${medType} ${release} ${popul} </div> </div>`
            $(".holder").append(card)
        }
    })
}

